import './GamesBody.css'
import backgImage from '../../../../public/images/backg.jpg';

export const GamesBody = () => {
  const backgroundImageStyle = {
    backgroundImage: `url(${backgImage})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundAttachment: 'fixed',
    backgroundRepeat: 'no-repeat',
  };

  return (
    <section className="gamebody" style={backgroundImageStyle}>
      <p className="title-body" id="selectedDate"></p>
      <div className="main-container" id="mainContainer"></div>
    </section>
  );
}
